graphviz:
digraph {
  // Graph attributes
  label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="center"><font point-size="12"><b>Multiplicity Examples</b></font></td></tr></table>>;
  labelloc="t";
  fontsize=10;
  fontname="Arial";
  compound=true;
  rankdir=TB;
  pad=0.25;
  node [fontname="Arial", fontsize=10];
  edge [fontname="Arial", fontsize=9];

  // Node definitions with nested namespaces
  "User" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>User</b> <i>&lt;task&gt;</i></td></tr><tr><td align="left">User Account</td></tr><tr><td><table border="0" cellborder="1" cellspacing="0" cellpadding="2" align="left"><tr><td port="name__key" align="left" balign="left">name : string</td><td port="name__value" align="left" balign="left">John Doe</td></tr><tr><td port="email__key" align="left" balign="left">email : string</td><td port="email__value" align="left" balign="left">john@example.com</td></tr></table></td></tr></table>>, shape=box, fillcolor="#E3F2FD", style=filled, color="#1976D2"];
  "Order" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>Order</b> <i>&lt;task&gt;</i></td></tr><tr><td align="left">Customer Order</td></tr><tr><td><table border="0" cellborder="1" cellspacing="0" cellpadding="2" align="left"><tr><td port="orderId__key" align="left" balign="left">orderId : number</td><td port="orderId__value" align="left" balign="left">1</td></tr><tr><td port="total__key" align="left" balign="left">total : number</td><td port="total__value" align="left" balign="left">99.99</td></tr></table></td></tr></table>>, shape=box, fillcolor="#E3F2FD", style=filled, color="#1976D2"];
  "LineItem" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>LineItem</b> <i>&lt;task&gt;</i></td></tr><tr><td align="left">Order Line Item</td></tr><tr><td><table border="0" cellborder="1" cellspacing="0" cellpadding="2" align="left"><tr><td port="productId__key" align="left" balign="left">productId : string</td><td port="productId__value" align="left" balign="left">P123</td></tr><tr><td port="quantity__key" align="left" balign="left">quantity : number</td><td port="quantity__value" align="left" balign="left">1</td></tr></table></td></tr></table>>, shape=box, fillcolor="#E3F2FD", style=filled, color="#1976D2"];
  "Payment" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>Payment</b> <i>&lt;task&gt;</i></td></tr><tr><td align="left">Payment Details</td></tr><tr><td><table border="0" cellborder="1" cellspacing="0" cellpadding="2" align="left"><tr><td port="paymentId__key" align="left" balign="left">paymentId : string</td><td port="paymentId__value" align="left" balign="left">PAY123</td></tr><tr><td port="amount__key" align="left" balign="left">amount : number</td><td port="amount__value" align="left" balign="left">99.99</td></tr></table></td></tr></table>>, shape=box, fillcolor="#E3F2FD", style=filled, color="#1976D2"];
  "ShippingAddress" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>ShippingAddress</b> <i>&lt;task&gt;</i></td></tr><tr><td align="left">Shipping Address</td></tr><tr><td><table border="0" cellborder="1" cellspacing="0" cellpadding="2" align="left"><tr><td port="street__key" align="left" balign="left">street : string</td><td port="street__value" align="left" balign="left">123 Main St</td></tr><tr><td port="city__key" align="left" balign="left">city : string</td><td port="city__value" align="left" balign="left">Springfield</td></tr></table></td></tr></table>>, shape=box, fillcolor="#E3F2FD", style=filled, color="#1976D2"];
  "Product" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>Product</b> <i>&lt;task&gt;</i></td></tr><tr><td><table border="0" cellborder="1" cellspacing="0" cellpadding="2" align="left"><tr><td port="productId__key" align="left" balign="left">productId : string</td><td port="productId__value" align="left" balign="left">P123</td></tr><tr><td port="name__key" align="left" balign="left">name : string</td><td port="name__value" align="left" balign="left">Widget</td></tr></table></td></tr></table>>, shape=box, fillcolor="#E3F2FD", style=filled, color="#1976D2"];
  "Category" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>Category</b> <i>&lt;task&gt;</i></td></tr><tr><td align="left">Product Category</td></tr><tr><td><table border="0" cellborder="1" cellspacing="0" cellpadding="2" align="left"><tr><td port="categoryId__key" align="left" balign="left">categoryId : string</td><td port="categoryId__value" align="left" balign="left">C1</td></tr><tr><td port="name__key" align="left" balign="left">name : string</td><td port="name__value" align="left" balign="left">Electronics</td></tr></table></td></tr></table>>, shape=box, fillcolor="#E3F2FD", style=filled, color="#1976D2"];
  "Team" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>Team</b> <i>&lt;task&gt;</i></td></tr><tr><td align="left">Development Team</td></tr><tr><td><table border="0" cellborder="1" cellspacing="0" cellpadding="2" align="left"><tr><td port="teamName__key" align="left" balign="left">teamName : string</td><td port="teamName__value" align="left" balign="left">Backend Team</td></tr></table></td></tr></table>>, shape=box, fillcolor="#E3F2FD", style=filled, color="#1976D2"];
  "Developer" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>Developer</b> <i>&lt;task&gt;</i></td></tr><tr><td align="left">Team Member</td></tr><tr><td><table border="0" cellborder="1" cellspacing="0" cellpadding="2" align="left"><tr><td port="name__key" align="left" balign="left">name : string</td><td port="name__value" align="left" balign="left">Jane Smith</td></tr><tr><td port="role__key" align="left" balign="left">role : string</td><td port="role__value" align="left" balign="left">Developer</td></tr></table></td></tr></table>>, shape=box, fillcolor="#E3F2FD", style=filled, color="#1976D2"];

  // Edges
  "User" -> "Order" [taillabel="1", headlabel="*", style="dashed", labelOverlay="75%", labelhref="#srcLineTBD"];
  "Order" -> "LineItem" [taillabel="1", headlabel="1..*", style="dashed", labelOverlay="75%", labelhref="#srcLineTBD"];
  "Order" -> "Payment" [taillabel="1", headlabel="1", style="dashed", labelOverlay="75%", labelhref="#srcLineTBD"];
  "User" -> "ShippingAddress" [taillabel="1", headlabel="0..1", style="dashed", labelOverlay="75%", labelhref="#srcLineTBD"];
  "Product" -> "Category" [taillabel="*", headlabel="*", style="dashed", labelOverlay="75%", labelhref="#srcLineTBD"];
  "Team" -> "Developer" [taillabel="1", headlabel="3..10", style="dashed", labelOverlay="75%", labelhref="#srcLineTBD"];
}
